/* setup the KEY interrupts in the FPGA */
void config_KEYs() { 
    volatile int * KEY_ptr = (int *) 0xFF200050; // pushbutton KEY base address
    *(KEY_ptr + 2) = 0xF; // enable interrupts for the two KEYs
}


// Define the IRQ exception handler 
void __attribute__((interrupt)) __cs3_isr_irq(void) {
    // Read the ICCIAR from the CPU Interface in the GIC
    int interrupt_ID = *((int *)0xFFFEC10C);
    if (interrupt_ID == 73){ // check if interrupt is from the KEYs
        pushbutton_ISR();
    }
    else {
        while (1);
    }
    // Write to the End of Interrupt Register (ICCEOIR)
    *((int *)0xFFFEC110) = interrupt_ID;
}


/*
* Turn off interrupts in the ARM processor
*/
void disable_A9_interrupts(void) {
    int status = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}


/*
* Turn on interrupts in the ARM processor
*/
void enable_A9_interrupts(void) {
    int status = 0b01010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}



/*
* Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack(void) {
    int stack, mode;
    stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]" : : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}


/*
* Configure the Generic Interrupt Controller (GIC)
*/
void config_GIC(void) {
    config_interrupt (73, 1); // configure the FPGA KEYs interrupt (73)
    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all priorities
    *((int *) 0xFFFEC104) = 0xFFFF;
    // Set CPU Interface Control Register (ICCICR). Enable signaling of interrupts
    *((int *) 0xFFFEC100) = 1;
    // Configure the Distributor Control Register (ICDDCR) to send pending interrupts to CPUs
    *((int *) 0xFFFED000) = 1;
}

/********************************************************************
* Pushbutton - Interrupt Service Routine
*******************************************************************/
void pushbutton_ISR(void) {
    /* KEY base address */
    volatile int * KEY_ptr = (int *) KEY_BASE;
    int press;
    press = *(KEY_ptr + 3); // read the key interrupt register
    *(KEY_ptr + 3) = press; // Clear the interrupt
    if (press & 0x1){ // KEY0
        printf("Key0 is pressed, player A's turn\n");  //start of player A
		switches_ISR();
        playerA_0 = false;  //after pressed, bool is true, A select color
        playerB_1 = true;
        // 
        // select colour for player one function
    } else if (press & 0x2){ // KEY1
		switches_ISR();
        printf("Key1 is pressed, player B's turn\n");  //end of player A, start of player B
        playerB_1 = false;  //after pressed, bool is true, B select color
        playerA_0 = true;
        // select colour for player two function
    } else{ 
       printf("Wrong key pressed, press KEY0 for player A's turn and KEY1 for player B's turn\n");
       playerA_0 = false;
       playerB_1 = false;
    }
    return;
}

void switches_ISR (void){
    volatile int* SW_ptr = (int *) SW_BASE;
    int switch_value = *SW_ptr;

    if (switch_value & 0x1){ // SW0
        printf("SW0 is ON\n");
        yellow_0 = true;
        pink_1 = false;
        cyan_2 = false;
        blue_3 = false;
        grey_4 = false;
    } else if (switch_value & 0x2){ // SW1
        printf("SW1 is ON\n");
        pink_1 = true;
        yellow_0 = false;
        cyan_2 = false;
        blue_3 = false;
        grey_4 = false;
    } else if(switch_value & 0x4){  //Sw2
		printf("SW2 is ON\n");
        cyan_2 = true;
        pink_1 = false;
        yellow_0 = false;
        blue_3 = false;
        grey_4 = false;
    }else if(switch_value & 0x8){  //Sw3
		printf("SW3 is ON\n");
        blue_3 = true;
        cyan_2 = false;
        pink_1 = false;
        yellow_0 = false;
        grey_4 = false;
    }else if(switch_value & 0x10){  //SW4
		printf("SW4 is ON\n");
        grey_4 = true;
        blue_3 = false;
        cyan_2 = false;
        pink_1 = false;
        yellow_0 = false;
    }
    else{ 
       printf("No switch is ON\n");
       grey_4 = false;
        blue_3 = false;
        cyan_2 = false;
        pink_1 = false;
        yellow_0 = false;
    }

}

void config_interrupt(int N, int CPU_target) {
    int reg_offset, index, value, address;
    /* Configure the Interrupt Set-Enable Registers (ICDISERn).
    * reg_offset = (integer_div(N / 32) * 4
    * value = 1 << (N mod 32) */
    reg_offset = (N >> 3) & 0xFFFFFFFC;
    index = N & 0x1F;
    value = 0x1 << index;
    address = 0xFFFED100 + reg_offset;
    /* Now that we know the register address and value, set the appropriate bit */
    *(int *)address |= value;
    /* Configure the Interrupt Processor Targets Register (ICDIPTRn)
    * reg_offset = integer_div(N / 4) * 4
    * index = N mod 4 */
    reg_offset = (N & 0xFFFFFFFC);
    index = N & 0x3;
    address = 0xFFFED800 + reg_offset + index;
    /* Now that we know the register address and value, write to (only) the
    * appropriate byte */
    *(char *)address = (char)CPU_target;
}

void getColor(int colorNum){
    switch(colorNum){
        case 0:
            return YELLOW;
            break;
        case 1:
            return PINK;
            break;
        case 2:
            return CYAN;
            break;
        case 3:
            return BLUE;
            break;
        case 4:
            return GREY;
            break;
        default:
            return WHITE;
    }

}

void wait(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020; // pixel (DMA) controller (I/O)
    register int status;
    *pixel_ctrl_ptr = 1; // start synchronization; s bit is set to 1
    status = *(pixel_ctrl_ptr + 3); // read status register at address
    while ((status & 0x01) != 0){
        status = *(pixel_ctrl_ptr+3);
    }
}

